css:
.sheet-toolbar .btn-toolbar img.content-mask {
  background-color: #f6f6f6;
}
.sheet-toolbar-container {
  background-image: -webkit-linear-gradient(top, #41403b, #34332f);
  box-shadow: none;
}
.sheet-toolbar-container .btn {
  background: #4c4b45;
}
.sheet-toolbar-container .btn.btn-toolbar {
  color: #f6f6f6;
}
.sheet-toolbar-container .toolbar-activity .activity-toolbar-icon {
  background: #f6f6f6;
}
.sheet-toolbar .item-back img.content-mask {
  background-color: #f6f6f6;
}
.sheet-toolbar .item-back .item-back-title {
  color: #f6f6f6;
}
.sheet-toolbar .selection-bar .absolute {
  border-color: #4e4d47;
  background-color: #2c2b28;
}
.sheet-toolbar .selection-bar .absolute .inner .centered {
  color: #f6f6f6;
}
.btn-icon img.content-mask {
  background-color: #f6f6f6;
  color: #f6f6f6;
}
.btn-icon img.content-mask:hover {
  background-color: #f07746;
}
.developer-bar {
  -webkit-font-smoothing: auto;
  background-color: #505050;
  border-top: 1px solid rgba(0, 0, 0, 0.7);
  color: white;
  font-size: 12px;
  display: flex;
  flex-direction: column;
  height: 100%;
}
.developer-bar .controls {
  z-index: 2;
  background-color: #505050;
  position: relative;
  min-height: 30px;
  -webkit-app-region: drag;
}
.developer-bar .controls .btn-container {
  -webkit-app-region: no-drag;
}
.developer-bar .footer {
  padding: 2px;
}
.developer-bar .footer input.filter {
  margin-left: 4px;
  padding: 2px;
  color: black;
  vertical-align: middle;
  width: 400px;
}
.developer-bar .section-content {
  position: relative;
  z-index: 1;
}
.developer-bar .queue-buttons {
  position: relative;
  z-index: 1;
}
.developer-bar .btn {
  padding: 5px;
  font-size: 13px;
  line-height: 15px;
  height: 25px;
  background: #3c3c3c;
  color: white;
}
.developer-bar .btn:hover {
  background: #282828;
}
.developer-bar .fa-caret-square-o-down,
.developer-bar .fa-caret-square-o-up {
  display: inline-block;
  width: 20px;
  height: 20px;
  float: left;
  margin: 7px;
  margin-bottom: 0;
  font-size: 18px;
}
.developer-bar .btn-container {
  padding: 3px;
}
.developer-bar .activity-status-bubble {
  border-radius: 6px;
  display: inline-block;
  margin-right: 5px;
  margin-top: -2px;
  width: 11px;
  height: 11px;
  vertical-align: middle;
}
.developer-bar .activity-status-bubble.state-connecting {
  background-color: #aff2a7;
}
.developer-bar .activity-status-bubble.state-connected {
  background-color: #94E864;
}
.developer-bar .activity-status-bubble.state-none,
.developer-bar .activity-status-bubble.state-closed,
.developer-bar .activity-status-bubble.state-ended {
  background-color: gray;
}
.developer-bar .expanded-section {
  clear: both;
  flex: 1;
  border-top: 1px solid black;
  padding-top: 8px;
  padding-bottom: 8px;
  overflow-y: scroll;
  background-color: rgba(0, 0, 0, 0.5);
  font-family: monospace;
  -webkit-user-select: auto;
}
.developer-bar .expanded-section.queue {
  padding: 0;
}
.developer-bar .expanded-section.queue .btn {
  float: right;
  z-index: 10;
}
.developer-bar .expanded-section.queue hr {
  margin: 1em 0;
}
.developer-bar .expanded-section .item {
  overflow-x: hidden;
  text-overflow: ellipsis;
}
.developer-bar .expanded-section.curl-history .item {
  padding-left: 8px;
  padding-right: 8px;
  padding-bottom: 3px;
}
.developer-bar .expanded-section.curl-history .timestamp {
  color: rgba(255, 255, 255, 0.5);
}
.developer-bar .expanded-section.curl-history .error-code {
  background-color: #740000;
}
.developer-bar .expanded-section.curl-history .item.status-code-500,
.developer-bar .expanded-section.curl-history .item.status-code-501,
.developer-bar .expanded-section.curl-history .item.status-code-502,
.developer-bar .expanded-section.curl-history .item.status-code-503,
.developer-bar .expanded-section.curl-history .item.status-code-504,
.developer-bar .expanded-section.curl-history .item.status-code-400,
.developer-bar .expanded-section.curl-history .item.status-code-404,
.developer-bar .expanded-section.curl-history .item.status-code-409 {
  background-color: #740000;
}
.developer-bar .expanded-section.curl-history .code {
  float: right;
  clear: right;
  opacity: 0.5;
}
.developer-bar .expanded-section.curl-history a {
  padding-right: 4px;
  border-bottom: 0;
}
.developer-bar .expanded-section.curl-history a:hover {
  border-bottom: 0;
  text-decoration: none;
  background-color: #003845;
  color: white;
}
.developer-bar .expanded-section.long-polling .item {
  padding-left: 8px;
  padding-right: 8px;
  padding-bottom: 3px;
}
.developer-bar .expanded-section.long-polling .item .cursor {
  float: right;
  clear: right;
  opacity: 0.5;
}
.developer-bar .expanded-section.long-polling .item:hover {
  cursor: pointer;
  background-color: rgba(255, 255, 255, 0.2);
}
.developer-bar .expanded-section.long-polling .item .payload {
  white-space: pre;
  color: burlywood;
}
.developer-bar .expanded-section.long-polling .item.ignored {
  opacity: 0.5;
}
.developer-bar .task {
  padding: 0.5em 1em 0.5em 1.5em;
  margin: 2px 0;
  position: relative;
}
.developer-bar .task:hover {
  cursor: pointer;
  background-color: rgba(255, 255, 255, 0.2);
}
.developer-bar .task:before {
  content: " ";
  position: absolute;
  top: 0;
  left: 0;
  width: 10px;
  height: 100%;
  background: #b4babd;
}
.developer-bar .task.task-queued.task-is-processing:before {
  background: #009ec4;
}
.developer-bar .task.task-completed.task-local-error:before,
.developer-bar .task.task-completed.task-remote-error:before {
  background: #ca2541;
}
.developer-bar .task.task-completed.task-completed.task-success:before {
  background: #00ac6f;
}
.developer-bar .task .task-details {
  display: none;
}
.developer-bar .task.task-expanded .task-details {
  display: block;
  white-space: pre;
}
